import React from "react";

class LoginForm extends React.Component{
	constructor(props){
		super(props);

	}

	render() {
		return (
			<div>
			First name:<input type="text" name="fname"/>
  			Last name:<input type="text" name="lname"/>
  			<input type="submit" value="Submit"/>
  			</div>
			);
	}
}

export default LoginForm;
